webpackJsonp([0xa1ad1c3f4309],{5358:function(e,t){e.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/10/helga0117.jpg" height="225" width="300" border="0" alt="helga0117.jpg: " /></p>\n<p>Helga, the grey and black tabby cat from the Humane Society in  Minneapolis, who had accompanied us since 1985, died in her sleep this afternoon. She had had heart problems for the past year, and had become progressively weaker the past few weeks. Of our three cats, she was the "party cat". She was the cat we\'d see the most around the house, and whenever we had visitors, she always stayed with them. We will miss her.</p>',fields:{title:"Friend and Companion",date:"11 Oct 2001",url:"https://papascott.de/2001-10-11-friend-and-companion/"}}},pathContext:{slug:"/2001-10-11-friend-and-companion/",prev:{fields:{title:"No Other Way",date:"10 Oct 2001",slug:"/2001-10-10-no-other-way/"}},next:{fields:{title:"Stofftier",date:"13 Oct 2001",slug:"/2001-10-13-stofftier/"}}}}}});
